import Form from './loginPage/Form';
import Login from './loginPage/Login';

function App() {
  return (
    <>
      <div className="container pd-">
        <Form />
        <br />
        <Login />
      </div>
      {/* <MainComponent /> */}
    </>
  );
}

export default App;
